import {BrowserRouter, Routes, Route,} from "react-router-dom";
import books from "./pages/books";

function App() {
  return (
    <div className="App">
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Books/>}/>
      </Routes>
    </BrowserRouter>
    </div>
  );
}

export default App;
